import axios from 'axios';

export async function getUser(userId) {

    console.log("[US] [GET] START");
    let response = await axios.get('http://localhost:8000/user', {
        params: {
            id: userId
        }
    }).then(response => response = response.data
    ).catch(function(err) {
       console.log("[US] [GET] ERROR: " + err); 
       return err;
    }).then(function () {
        // always executed
        console.log('[US] [GET] user_data DATA: ' + response);
        console.log("[US] [GET] COMPLETE");
        return response;
      });
      return response; 
}
